%spark.pyspark
def bin_count(count):
    if count==0: 
        return '0'
    elif 0<count<=1:
        return '0-1'
    elif 1<count<=3:
        return '1-3'
    elif 3<count<=5:
        return '3-5'
    elif 5<count<=10:
        return '5-10'
    elif 10<count<=15:
        return '10-15'
    elif 15<count<=20:
        return '15-20'
    elif 20<count<=30:
        return '20-30'
    elif 30<count<=50:
        return '30-50'
    elif 50<count<=75:
        return '50-75'
    elif 75<count<=100:
        return '75-100'
    elif 100<count<=150:
        return '100-150'
    elif 150<count<=250:
        return '150-250'
    elif 250<count<=350:
        return '250-350'
    else:
        return '350-inf'

bin = F.udf(bin_count, StringType())
